import React, { Component } from 'react'
import axios from 'axios'

class Posts extends Component {
    constructor(props) { 
        super(props);
        this.state = {
            posts: []
        };
     }


    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then(res => console.log(res.data))
    }

    render() {
        return (
            <div>
                <h1>
                    Posts 
                </h1>
            </div>
        )
    }
}

export default Posts;
